import React from 'react'
import ReactTable from 'react-table'
import "react-table/react-table.css"


const columns = [
    {
        Header: "First Name",
        accessor: "firstName",
        style: {
            textAlign: "left"
        },
        width: 150,
        minWidth: 100,
        maxWidth: 200
    },
    {
        Header: "Last Name",
        accessor: "lastName",
        width: 150,
        minWidth: 100,
        maxWidth: 200
    },
    {
        Header: "Company",
        accessor: "company.name"
    },
    {
        Header: "City",
        accessor: "address.city"
    },
    {
        Header: "Email",
        accessor: "email",
        sortable: false,
        filterable: false
    }]
const user = () => {
    return <ReactTable
    columns={columns}
    data={this.props.data}
    filterable
    defaultPageSize={1000}
    showPagination={false}
>
</ReactTable>
}

export default user;
